أطول قَسَم في القرآن يتكون من ١١ قَسَم :

{والشمس وضحاها ۝والقمر إذا تلاها ۝والنهار إذا جلاها ۝والليل إذا يغشاها ۝والسماء وما بناها ۝والأرض وما طحاها ۝ونفس وما سواها}

ماذا تريد أن تقول لنا يا رب بعد كل هذه الأيمان ؟

جواب القسم جملتان :

{قد أَفْلح من زكّاها ۝ وقد خاب من دسّاها}
